		private static Random rnd = new Random();
		public static short GetRandom(int min, int max)
		{
			if (max > short.MaxValue)
				throw new Exception("Too big you dummy");

			int output = rnd.Next(min, max);

			return (short)output;
		}

		static float GetFloat(float min, float max)
		{
			System.Random random = new System.Random();
			double val = (random.NextDouble() * (max - min) + min);
			return (float)val;
		}

		public static bool GetBoolean(short posChance = 3)
		{
			// 1 in 3 chance of being true
			int output = rnd.Next(0, posChance);

			if (output == 0)
				return true;
			else
				return false;
		}

